import React, { useEffect, useState } from "react";
import './../App.css';

const CallendarCard = ({day, events}) => {
    const callendarCardClicked = () => {
        console.log("Clicked on day: " + day);
    }

    return(
        <div class="callendar-card" onClick={callendarCardClicked}>
            <p class="title">dzien: {day} </p>
            <p>
            {events.map(event => (
                <>{event.name}<br /></>
            ))}
            </p>
        </div>
    )
}

export default CallendarCard;
